import React, { useState } from "react";
import PatientService from "../services/PatientService";
import "./ConsultationPage.css";
import { useNavigate } from "react-router-dom";

function ConsultationPage() {
  const navigate = useNavigate();
  const [cpf, setCpf] = useState("");
  const [nome, setNome] = useState("");
  const [idade, setIdade] = useState("");
  const [numero, setNumero] = useState("");
  const [email, setEmail] = useState("");
  const [erro, setErro] = useState("");
  const [mensagem, setMensagem] = useState("");

  const handleBuscarPaciente = async () => {
    setErro("");
    setMensagem("");
    try {
      const patient = await PatientService.getPatientByCpf(cpf);
      setNome(patient.nome);
      setIdade(patient.idade);
      setNumero(patient.numero);
      setEmail(patient.email);
      setMensagem("Paciente encontrado!");
    } catch (error) {
      setErro(error.message);
    }
  };

  const handleRegistrarPaciente = async () => {
    setErro("");
    setMensagem("");
    try {
      await PatientService.registerPatient({ cpf, nome, idade, numero, email });
      setMensagem("Paciente cadastrado com sucesso!");
    } catch (error) {
      setErro(error.message);
    }
  };

  return (
    <div className="consultation-container">
        <header className="consultation-header">
            <h1>MedGuia</h1>
            <button className="btn-black" onClick={() => navigate("/doctor")}>
                Voltar
            </button>
        </header>

      <section className="consultation-form-section">
        <h2>Dados da consulta</h2>
        <p>Preencha os campos com os dados do paciente</p>

        {erro && <p className="error">{erro}</p>}
        {mensagem && <p className="success">{mensagem}</p>}

        <div className="form-row">
          <div className="input-group">
            <label>CPF</label>
            <input
              type="text"
              value={cpf}
              onChange={(e) => setCpf(e.target.value)}
              placeholder="Digite o CPF do paciente"
            />
          </div>
          <button className="btn-black" onClick={handleBuscarPaciente}>
            Buscar paciente
          </button>
          <button className="btn-black" onClick={handleRegistrarPaciente}>
            Registrar paciente
          </button>
        </div>

        <div className="form-grid">
          <div className="input-group">
            <label>Nome</label>
            <input
              type="text"
              value={nome}
              onChange={(e) => setNome(e.target.value)}
              placeholder="Digite o nome do paciente"
            />
          </div>
          <div className="input-group">
            <label>Idade</label>
            <input
              type="number"
              value={idade}
              onChange={(e) => setIdade(e.target.value)}
              placeholder="Digite a idade"
            />
          </div>
          <div className="input-group">
            <label>Número</label>
            <input
              type="text"
              value={numero}
              onChange={(e) => setNumero(e.target.value)}
              placeholder="(85) 99999-9999"
            />
          </div>
          <div className="input-group">
            <label>Email</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Digite o email"
            />
          </div>
        </div>
      </section>

      <section className="symptoms-section">
        <h2>Selecione os sintomas</h2>
        <p>Selecione os sintomas que for percebendo durante a anamnese do paciente</p>
        <button className="btn-blue">Gerar Sugestão</button>

        <div className="symptoms-grid">
          <div className="symptom-card">Sintoma 1</div>
          <div className="symptom-card">Sintoma 2</div>
          <div className="symptom-card">Sintoma 3</div>
          <div className="symptom-card">Sintoma 4</div>
        </div>

        <button className="btn-create">Criar receita</button>
      </section>

      <footer className="consultation-footer">
        <p>© 2025 MedGuia | Privacy Policy | Terms of Use</p>
      </footer>
    </div>
  );
}

export default ConsultationPage;
